import React from 'react';

export default function TableGrid() {
  const rows = 12;  // Number of rows
  const columns = 12;  // Number of columns
  const totalCells = rows * columns;  // Total number of cells

  const cellSize = 50;  // Size of each cell

  return (
    <div className="flex flex-col items-center mt-4">
      <div className="grid grid-cols-12 gap-0">
        {new Array(totalCells).fill(null).map((_, index) => (
          <div
            key={index}
            style={{
              height: `${cellSize}px`,
              width: `${cellSize}px`,
              backgroundColor: '#ddd',  // Cell color
              border: '1px solid #bbb',  // Border to separate cells
            }}
            className="cursor-pointer"
          />
        ))}
      </div>
    </div>
  );
}
